/**
 * @module RaftParser
 */ /** */

import GCodeParser from "./gcode";
import RaftEngine from "../engines/base";

export default class HVSParser extends GCodeParser {

    constructor (engine: RaftEngine) {
        super(engine);
    }

    public clone(): HVSParser {
        return new HVSParser(this.engine.clone());
    }

    toString(): string {
        return "HVSParser";
    }

}
